execution.script:
pipeline {
    environment {
        imagename = "fdc-api"
        ecrurl = "https://837587249384.dkr.ecr.us-west-2.amazonaws.com"
        ecrcredentials = "ecr:us-west-2:aws-credentials"
        dockerTag = "latest-${BUILD_NUMBER}-${BUILD_TIMESTAMP}"
    } 
    agent any
    stages {
        stage('Buid Jar aftifacts') {
            steps {
                withMaven {
                    sh "mvn clean install -Dmaven.test.skip=false"
                }
            }
        }
        stage('Building docker image') {
            steps{
                script {
                        if (releaseVersion == 'latest') {
                            dockerTag = "latest-${BUILD_NUMBER}-${BUILD_TIMESTAMP}"
                        } else {
                            dockerTag = "${params.releaseVersion}"
                        }

                  dockerImage = docker.build("837587249384.dkr.ecr.us-west-2.amazonaws.com/$imagename","--build-arg STRIPE_KEY=abc -f Dockerfile .")
                }
            }
        }
        stage('Publishing docker Image') {
            steps{
                script {
                  docker.withRegistry(ecrurl, ecrcredentials) {     
                     dockerImage.push(dockerTag)

                  }
                }
            }
        }
        stage ('Updating Parameter File') {
            steps {
                sh '''
                      ImageTag=$(grep -A1 "ImageTag" ${WORKSPACE}/fdc-svc-api-${fdcenv}-parameter.json | tail -1 | cut -d ":" -f2 | cut -d "\\"" -f2)
                      if [ $releaseVersion = "latest" ]
                      then
                       sed -i "s/$ImageTag/${dockerTag}/" ${WORKSPACE}/fdc-svc-api-${fdcenv}-parameter.json
                      else
                       sed -i "s/$ImageTag/${releaseVersion}/" ${WORKSPACE}/fdc-svc-api-${fdcenv}-parameter.json
                      fi
                      '''
            }
        } 
        stage('Deploying stack in ${fdcenv} environment') {
            steps {
                script {
                    if (fdcenv == 'dev') {
                               withAWS(roleAccount:'051244547718', role:'AllowAltirJenkins') {
                                    sh 'cat fdc-svc-api-${fdcenv}-parameter.json'
                                    sh 'aws cloudformation update-stack --stack-name fdc-svc-api-${fdcenv} --region us-west-2 --template-body file://${WORKSPACE}/fdc-svc-api.yml --parameters file://${WORKSPACE}/fdc-svc-api-${fdcenv}-parameter.json --capabilities "CAPABILITY_IAM" "CAPABILITY_NAMED_IAM"'
                                    sh 'aws cloudformation wait stack-update-complete --stack-name fdc-svc-api-${fdcenv} --region us-west-2'
                               }
                    } else if (fdcenv == 'stage') {
                               withAWS(roleAccount:'579576404934', role:'AllowAltirJenkins') {
                                    sh 'cat fdc-svc-api-${fdcenv}-parameter.json'
                                    sh 'aws cloudformation update-stack --stack-name fdc-svc-api-${fdcenv} --region us-west-2 --template-body file://${WORKSPACE}/fdc-svc-api.yml --parameters file://${WORKSPACE}/fdc-svc-api-${fdcenv}-parameter.json --capabilities "CAPABILITY_IAM" "CAPABILITY_NAMED_IAM"'
                                    sh 'aws cloudformation wait stack-update-complete --stack-name fdc-svc-api-${fdcenv} --region us-west-2'
                               }
                    } else if (fdcenv == 'OnlyBuild') {
                                    sh 'echo "Build successful"'
                                    sh 'exit 0'
                    } else {
                                    sh 'echo "Please run this job for OnlyBuild or CI deployments"'
                                    sh 'exit 1'
                    }
                }
            }

        }
    }
}
